Identifikator licence, ki je globalno unikaten identifikator za licenco ali pogodbo, pod katero so predmeti generirani, predloženi za obdelavo in/ali plačani, ki je sestavljen z združevanjem:
 - kode izdajateljske agencije ISO/IEC 15459;
 - številke licence ali pogodbe, ki je v skladu s specifikacijami zadevne izdajateljske agencije;
 in da:
 - vsebuje samo velike črke abecede in/ali številčne znake;
 - je unikaten (to je, različen od katerega koli drugega identifikatorja, skladnega z ISO/IEC 15459) znotraj domene izdajateljske agencije;
 - ni mogoče izpeljati iz katerega koli drugega identifikatorja, skladnega z ISO/IEC 15459, izdanega pod isto izdajateljsko agencijo, z enostavnim dodajanjem znakov na konec ali njihovim odstranjevanjem.

Koda ribolovnega območja FAO, kot je določeno z oddelkom za ribištvo in akvakulturo FAO (http://www.fao.org. Iskanje pod-strani kode ribolovnega območja).
Dovoljeni so vsi znaki podmnožice GS1 General Specification, definirane z ISO/IEC 646.
Primeri:
18L37.1.3 Zahodno Sredozemsko morje, Sardinija;
18L47.B.1 Atlantik, jugovzhod, delitev SEAFO, namibijska izključna ekonomska cona;
18L67 Pacifik, severovzhod.

'26L' Koda lokacije, ki predstavlja kodo, ki identificira lokacijo ali geografsko območje ali povezano skupino takih lokacij ali območij, ki ima pomen za sorodno transakcijo in ki ustreza eni od struktur, definiranih v (a) do (f) spodaj:
a) dva velika črkovna znaka, ki ustrezata dvomestni alfa kodi države ISO 3166-1 države, v kateri se nahajajo ali sestavljajo lokacije ali območja;
b) tri velike črkovne znake, ki ustrezajo kodi IATA letališča ali mesta, v, blizu ali sestavljajočem lokacije ali območja;
c) štirje ali več znakov, od katerih prvi trije ustrezajo dvomestni kodi države ISO 3166-1, sledi vezaj (-), z ostalimi, ki predstavljajo poštno številko v dotični državi;
d) štirje ali več znakov, od katerih prvi trije ustrezajo dvomestni kodi države ISO 3166-1, sledi pika (.), z ostalimi, ki predstavljajo kodo podrazdelitve države ISO 3166-2 v dotični državi;
e) pet velikih črkovnih znakov, ki ustrezajo kodi UN/LOCODE območja, v, blizu ali sestavljajočem lokacije ali območja;
f) združevanje, dolžine ne manj kot sedem in ne več kot 35 znakov, sestavljenih iz:
- kode izdajateljske agencije ISO/IEC 15459;
- kode lokacije, sestavljene iz znakov, izbranih iz nabora {A-Z; 0-9}, ki ustrezajo specifikacijam zadevne izdajateljske agencije.

Lokacija dogodka UN/LOCODE.
UN/LOCODE, sledi plus (+) znak, sledi ena ali več kodnih vrednosti iz seznama kod EDIFACT 3227 'Kvalifikator funkcije lokacije', npr.,
7 Mesto končne dostave;
5 Pristanišče odhoda;
9 Pristanišče natovarjanja;
11 Pristanišče raztovarjanja;
13 Mesto pretovarjanja;
24 Pristanišče vstopa;
35 Država izvoza;
88 Mesto prevzema prevoznika;
125 Tuje pristanišče pred odhodom v ZDA;
147 Prostor za shranjevanje/lokacija;
159 Mesto dostave (prejemniku);
248 Lokacija nalaganja
http://www.unece.org/cefact/locode/.

Identifikator za specifično pomorsko opremo, odobreno po direktivi Evropske unije o pomorski opremi (2014/90/EU) in izvedbeni uredbi (EU) 2018/608.
Format:
• DI (an3);
• Vrsta modula(-ov) ocenjevanja skladnosti, določenih v Prilogi II k Direktivi 2014/90/EU, uporabljenih za ocenjevanje skladnosti (a1);
• Identifikacijska številka priglašenega organa, dodeljena s strani Komisije v skladu s točko 3.1 Priloge IV k Direktivi 2014/90/EU (n4);
• Potrdilo (an5...20)

Sistem informacij o vodnih znanostih in ribištvu (ASFIS) 'Medagencijska 3-črkovna koda vrste', vzdrževana s strani Organizacije za prehrano in kmetijstvo Združenih narodov (www.fao.org, nato iščite 'ASFIS').
Primeri;
