Metoda proizvodnje rib in morskih sadežev, kot je določeno z oddelkom za ribištvo in akvakulturo Organizacije za prehrano in kmetijstvo (FAO) Združenih narodov, v skladu z Uredbo EU 1379/2013. (www.fao.org).
