Identifikator opreme, ki je globalno unikaten identifikator za napravo, element opreme ali instanco računalniške aplikacije, uporabljene v proizvodnji, prevozu, obdelavi ali drugem ravnanju s predmeti, ki je sestavljen z združevanjem:
 - kode izdajateljske agencije ISO/IEC 15459;
 - številke opreme, ki je v skladu s specifikacijami zadevne izdajateljske agencije; in da:
 - vsebuje samo velike črke abecede in/ali številčne znake;
 - je unikaten (to je, različen od katerega koli drugega identifikatorja, skladnega z ISO/IEC 15459) znotraj domene izdajateljske agencije;
 - ni mogoče izpeljati iz katerega koli drugega identifikatorja, skladnega z ISO/IEC 15459, izdanega pod isto izdajateljsko agencijo, z enostavnim dodajanjem znakov na konec ali njihovim odstranjevanjem.

Koda lokacije UPU, ki predstavlja kodo za identifikacijo lokacije ali geografskega območja ali povezane skupine takih lokacij ali območij, ki so pomembna za povezano transakcijo in ki je skladna z eno od struktur, opredeljenih v točkah a) do g) spodaj:
a) dva velika tiskana abecedna znaka, ki ustrezata ISO 3166-1 dvema abecednima koda države, v kateri se nahaja ali ki jo sestavljajo lokacija(e) ali območje(a);
b) trije veliki tiskani abecedni znaki, ki ustrezajo kodi IATA letališča ali mesta, v katerem se nahaja, blizu katerega se nahaja ali ki ga sestavljajo lokacija(e) ali območje(a);
c) štirje ali več znakov, od katerih prvi trije ustrezajo kodi države ISO 3166-1, sledi vezaj (-), z ostankom, ki predstavlja poštno številko v dotični državi;
d) štirje ali več znakov, od katerih prvi trije ustrezajo kodi države ISO 3166-1, sledi pika (.), z ostankom, ki predstavlja kodo področja države ISO 3166-2 v dotični državi;
e) pet velikih tiskanih abecednih znakov, ki ustrezajo UN/LOCODE območja, v katerem se nahaja, blizu katerega se nahaja ali ki ga sestavljajo lokacija(e) ali območje(a);
f) šest velikih tiskanih alfanumeričnih znakov, ki ustrezajo kodi IMPC UPU, dodeljeni v skladu s standardom UPU S34;
g) združitev, ki ni krajša od sedmih in ne daljša od 25 znakov, ki obsega:
 - kodo izdajatelja, dodeljeno v skladu s standardi UPU S31;
 - kodo lokacije, ki obsega znake iz nabora {A-Z; 0-9}, ki so skladni s specifikacijami izdajatelja.

Registrska tablica s podatki o storitvi in kodo lokacije je sestavljena podatkovna struktura, skladna s specifikacijo v standardu UPU S25, ki vključuje specifikacijo:
 - identifikatorja predmeta, skladnega z ISO/IEC 15459;
 - identifikatorja podatkov 5U skladno s specifikacijo storitve, ki se zagotovi v zvezi s predmetom;
 - identifikatorja podatkov 17U skladno s kodo lokacije UPU ali identifikatorja podatkov 18U skladno s kvalificirano kodo lokacije UPU.
 Opomba - Za več podrobnosti glejte standard UPU S25. Razlika med preprosto kodo lokacije UPU (DI 17U) in kvalificirano kodo lokacije UPU (DI 18U) je razvidna iz prvega znaka. Če je ta numeričen, se uporabi 18U; če je abecedni, se uporabi 17U.

