Datum, predstavljen v modificirani obliki skladni z UTC:
yyyy[mm[dd[hh[mm[ss[fff]]]]]][poooo] kjer oglati oklepaji označujejo izbirnost in yyyy je leto, mmdd mesec in dan, hhmmss čas dneva v urah minutah in sekundah, fff deleži sekund in poooo odmik od UTC, izražen v urah in minutah, odmik je pozitiven, če je p pika (.), negativen, če je P minus (-).
PRIMER:
2005 - (UTC) koledarsko leto 2005;
200505 - (UTC) koledarski mesec maj 2005;
20050518 - (UTC) 18. maj 2005;
200505181247 - 12:47 UTC na 18. maj 2005;
200505181247.0100 - 12:47 lokalni čas, ki je 11:47 UTC, na 18. maj 2005;
20050518124723099 - 99 milisekund po 12:47:23 UTC na 18. maj 2005.

Kvalificiran datum, ki obsega združitev:
- kode izdajateljske agencije ISO/IEC 15459;
- kvalifikatorja datuma, ki je skladen s specifikacijami te izdajateljske agencije;
- datuma, katerega format in interpretacija sta skladna s specifikacijami te izdajateljske agencije za ta kvalifikator datuma.

Deklaracija o kategoriji embalažnega materiala*, kodi* in teži za določen embalažni material, uporabljen v določeni embalaži v skladu z direktivo EU o embalaži in odpadki embalaže. (Kategorija materiala in koda opredeljena v Prilogi M).
12ECCMMMMMMNNNNNUU kjer: - '12E' (an3) je identifikator podatkov;
 - 'CC' (n2) je kategorija materiala po Prilogi M;
 - 'MMMMMM' (an1...6) je koda materiala po Prilogi M;
 - 'NNNNN' (n5) teža materiala, vključno z decimalno točko (npr., 12.12);
 - 'UU' (an2) je enota mere za težo (npr., KG, GR, LB ali OZ po ANSI X12.3 kot v Prilogi D).

