Številka prejemnika.
Edinstvena identifikacijska številka je lahko IRS, EIN, SSN ali številka, dodeljena s strani CBP, kot je zahtevano na Varnostnem vložku. Uporabiti je treba samo naslednje formate: IRS EIN: NN-NNNNNNN;
IRS EIN z oznako:
NN-NNNNNNNXX;
SSN: NNN-NN-NNNN;
Številka, dodeljena s strani CBP: YYDDPP-NNNNN.
